import React from 'react'
import styles from '../styles/Header.scss'
const Header = () => {
    return (
        <div className={styles.HeaderContainer}>
            <div className={styles.LogoContainer}></div>
            <div className={styles.MenuContainer}></div>
        </div>
    )
}

export default Header
